import React, { Component } from "react";
import Emulator from "../../components/Emulator";

class EmulatorDemo extends Component {
  render() {
    return (
      <Emulator
        id="flow"
        rows={rows}
        cols={cols}
        text={text}
        style={style}
        cursor={cursor}
        readOnly
      />
    );
  }
}
export default EmulatorDemo;
